import React from 'react';
import {useState} from 'react';
import Country from './Components/Country';
import Header from './Components/Header';
import InputFilter from './Components/Input_filter';
import {Routes,Route} from 'react-router-dom'; 
import './Styles/styles.css';
import GroupOfCountries from './Components/GroupOfCountries';


function App() {
  const [darkMode,setDarkMode] = useState(false);

  const switchMode=()=>{
    setDarkMode((prevState)=> !prevState);
  }

  return (
    <div className={`app ${darkMode ? 'darkMode':''}`}>
       <Header onClick={switchMode} darkMode={darkMode}/>
        <div className={`appbo ${darkMode ? 'darkMode':''}`}>
         <InputFilter/>   
          <Routes>
            <Route exact path="/" element={<GroupOfCountries darkMode={darkMode}/>}/>
            <Route exact path="/country" element={<Country darkMode={darkMode}/>}/>
          </Routes>
        </div>
   </div>
  )
}

export default App
